import React from "react";
import classes from "./../Dialogs.module.css";

function Chat(props) {
  return (
    <div className={classes.chat}>
      <div className={classes.chatWindow}>window</div>
      <input type="text" />
      <button>Send</button>
    </div>
  );
}

export default Chat;
